import React from 'react'
import { BrowserRouter as Router, Routes, Route}
    from 'react-router-dom';
import Page from "./SecondPage/VideoPage"

function Navigate(){
    return(
      <>
      <Router>
        <Routes>
          <Route path='/VideoPage' element={<Page/>} />
        </Routes>
      </Router>
      </>
    )
  }
  export default Navigate;
